Johnny and Aleksa are a dull suburban couple entering a new age of sexual promiscuity and experimentation in the 1960s. Once invited to a &quot;key party&quot; by neighbours (in which wives draw keys at random from a bowl, determining which husband they go home with) the two are almost immediately paired up with stranger partners. Once they venture off into uncertainty, they soon discover that it's what they've been looking for all along - uninhibited and wild fuckin' sex!
